import React from 'react';
import {BlogSidebarWrapper,RecentPostHeading,RecentPostLayout,
    PostImageHolder,Img,PostHeading,Divider,CategoryLayout,Category
} from './blogsidebar.style';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BlogSidebar } from '../../../pagedata/BlogPage';
const BlogSidebarPage  = () => {
    return (
        <BlogSidebarWrapper>
            <RecentPostHeading>
                {BlogSidebar.RecentPostHeading}
            </RecentPostHeading>
            {
                BlogSidebar.RecentPost.map((item,idx) => {
                return <RecentPostLayout>
                    <PostImageHolder>
                        <Img 
                            src={require("../../../assets/"+item.PostImage)} 
                            alt=""
                        />
                    </PostImageHolder>
                    <PostHeading href="">
                        {item.PostHeading}
                    </PostHeading>
                </RecentPostLayout>
                })
            }
            <Divider />
            <RecentPostHeading>
            {BlogSidebar.CategoryPostHeading}
            </RecentPostHeading>
            <CategoryLayout>
            {
                BlogSidebar.CategoriesList.map((item,idx) => {
                return <Category href="#">
                        {item.Category}
                    </Category>
                })
            }
            </CategoryLayout>
        </BlogSidebarWrapper>

    );
}
export default BlogSidebarPage;
